eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   blogArticles: () => (/* binding */ blogArticles),\n/* harmony export */   certifications: () => (/* binding */ certifications),\n/* harmony export */   contactEmail: () => (/* binding */ contactEmail),\n/* harmony export */   projects: () => (/* binding */ projects),\n/* harmony export */   skills: () => (/* binding */ skills),\n/* harmony export */   socials: () => (/* binding */ socials),\n/* harmony export */   terminalCommands: () => (/* binding */ terminalCommands)\n/* harmony export */ });\nconst skills = [\n    {\n        icon: 'fab fa-js',\n        text: 'JavaScript (ES6+)'\n    },\n    {\n        icon: 'fab fa-wordpress',\n        text: 'WordPress'\n    },\n    {\n        icon: 'fab fa-python',\n        text: 'Python'\n    },\n    {\n        icon: 'fas fa-users',\n        text: 'Leadership'\n    },\n    {\n        icon: 'fas fa-brain',\n        text: 'AI Ethics'\n    },\n    {\n        icon: 'fas fa-pen-fancy',\n        text: 'Tech Writing'\n    }\n];\nconst terminalCommands = [\n    {\n        cmd: 'whoami',\n        out: 'Adeyemi Adeniji'\n    },\n    {\n        cmd: 'current_role',\n        out: 'Reflective Model Translation Partner'\n    },\n    {\n        cmd: 'studying',\n        out: 'B.Sc Computer Science (NOUN)'\n    },\n    {\n        cmd: 'stack --list',\n        out: 'JavaScript, Python, WordPress, AI Ethics'\n    }\n];\nconst projects = [\n    {\n        id: 1,\n        title: 'Universal CGPA Calculator',\n        description: 'A \"Student OS\" web app to track academic progress. Built with logic-heavy JavaScript to calculate cumulative grades dynamically.',\n        image: 'student-os.jpg',\n        tech: [\n            'JavaScript',\n            'HTML5',\n            'Vibe Coding'\n        ],\n        github: 'https://github.com/youngseeker',\n        live: 'https://my-student-os.vercel.app/'\n    },\n    {\n        id: 2,\n        title: 'Athalia Inn Events',\n        description: 'Luxury digital presence for an event planning brand. Focused on aesthetic translation using custom CSS and responsive design.',\n        image: 'athalia.jpg',\n        tech: [\n            'CSS3',\n            'Animation',\n            'Branding'\n        ],\n        live: 'https://athalia-website.vercel.app/'\n    },\n    {\n        id: 3,\n        title: 'Sam Soyombo Platform',\n        description: 'Website restructuring for a career coaching platform. Managed DNS migration (Cloudflare), hosting, and WordPress block optimization.',\n        image: 'sam.jpg',\n        tech: [\n            'WordPress',\n            'SEO Strategy',\n            'Cloudflare'\n        ],\n        live: 'https://samsoyombo.com/'\n    }\n];\nconst certifications = [\n    {\n        id: 1,\n        title: 'McKinsey Forward Program',\n        issuer: 'McKinsey & Company',\n        icon: 'fas fa-certificate',\n        year: 2025\n    },\n    {\n        id: 2,\n        title: 'Fundamentals of AI Ethics',\n        issuer: 'IBM / NOUN',\n        icon: 'fas fa-robot',\n        year: 2025\n    },\n    {\n        id: 3,\n        title: 'Python Data Structures',\n        issuer: 'Tech4Dev / Dataquest',\n        icon: 'fab fa-python',\n        year: 2025\n    },\n    {\n        id: 4,\n        title: 'Soft Skills Development',\n        issuer: 'Jobberman Nigeria',\n        icon: 'fas fa-user-tie',\n        year: 2025\n    }\n];\nconst blogArticles = [\n    {\n        id: 1,\n        title: 'The \"Outdated OS\" Trap: How to Hack Your Education for the AI Era',\n        excerpt: 'Why your degree isn\\'t broken  it\\'s just not designed to save you. A framework for upgrading your learning system.',\n        content: `Why your degree isn't broken  it's just not designed to save you\n\nThe Glitch Isn't the System. It's the Contract You Quietly Signed.\nWe're the first generation to grow up with super-intelligence in our pockets and still sit in lecture halls optimised for a world that no longer exists.\n\nThat mismatch isn't subtle. It's structural.\n\nUniversities are still grading obedience, memorisation, and speed  skills that made sense when information was scarce, and authority was centralised. Meanwhile, the economy outside the campus gates rewards synthesis, judgment, and the ability to learn faster than the environment changes.\n\nHere's the uncomfortable part:\nThe system isn't going to update itself in time for you.\n\nAnd that means responsibility lands somewhere awkward.\n\nAs neuroscientist Lisa Feldman Barrett puts it: \"Sometimes we're responsible for things not because they're our fault, but because we're the only ones who can change them.\"\n\nThe outdated OS isn't your fault.\nRunning it without modification is your choice.\n\nIf you treat university like a checklist  attend class, memorise slides, pass exams  you may graduate on time and still arrive late to the future. A high GPA is no longer the finish line. It's the baseline.\n\nDifferentiation is the real degree.\n\nYour Mind Is Software. Most Students Never Update It.\nYou can't run 2025 applications on 1990 hardware and blame the app when it crashes.\n\nYet that's exactly what most students do.\n\nThey optimise for grades instead of capability. They mistake familiarity for mastery. They confuse motion with progress. Over time, they accumulate something dangerous: learning debt  knowledge that works in exams but collapses under real pressure.\n\nIf you want leverage in the AI era, you have to treat learning like software: audit what you know, patch what's broken, and upgrade continuously  even when the syllabus says you're \"done.\"\n\nThe Four Stages of Competence (And Where Most People Stall)\nMost students study to pass.\nYou need to study to evolve.\n\nThe Four Stages of Competence turn learning from a vague obligation into a navigable system  but only if you're honest about where you are.\n\n1. Unconsciously Unskilled  The Unknown Unknowns\n\nThis is where you don't know what you don't know.\n\nThe trap here is comfort. Sticking strictly to the syllabus feels safe, but syllabi are often years behind reality. They reflect what was stable, not what is emerging.\n\nThe hack is exploring the adjacent possible  the edges of your discipline where new value forms. Computer science collides with biology. Law collides with code. Psychology collides with product design.\n\nThat overlap is where futures are hiding.\n\nUse AI here not as a tutor, but as a radar: \"What are three disruptive ideas outside my major that will likely reshape my career within five years?\"\n\n2. Consciously Unskilled  The Gap\n\nThis is the moment of friction  when you realise you don't understand something that matters.\n\nIt feels like incompetence. Most people interpret it as a signal to stop.\n\nThat's the mistake.\n\nAvoidance doesn't protect you. Avoidance is stagnation. Eliminating all potential threats also means eliminating all potential for growth.\n\nThis stage isn't failure; it's information. Discomfort is the download bar telling you exactly what you need next.\n\nInstead of asking why you're struggling, ask what: What specifically don't I understand? What assumption is breaking down? What skill would make this easier next time?\n\n3. Consciously Skilled  The Grind\n\nNow you understand  but only with effort.\n\nThis is where shortcuts are most tempting and most destructive.\n\nYou cannot automate understanding. You cannot outsource intuition. You cannot copy-paste your way to judgment.\n\nAI misuse here doesn't just slow growth; it actively makes you worse by eroding the mental muscle that expertise requires.\n\nThe rule is simple: AI can challenge your thinking, but it cannot replace it.\n\n4. Unconsciously Skilled  The Upgrade\n\nEventually, the skill becomes automatic.\n\nThis is where grades improve  and growth quietly dies.\n\nAn 'A' is not mastery. It's just proof you solved a local problem under fixed conditions. Comfort here is seductive, but it's also a ceiling.\n\nThe move isn't to abandon depth for novelty. It's to automate what should be automatic so your attention can attack harder problems  problems without answer keys.\n\nWhen You Fail (And You Will), Debug Instead of Spiralling\nThe system is buggy. You will bomb a test, misjudge a project, or realise too late that your strategy was wrong.\n\nWhen that happens, don't brute-force harder studying. That's just panic disguised as effort.\n\nUse the APR protocol: Awareness, Pause, and Reframe. Your job isn't to feel better. It's to patch the system.\n\nThe Real Point of a Degree\nA degree might get you to the interview.\nIt won't make you irreplaceable.\n\nThat comes from intent  from treating learning as an active experiment rather than a passive requirement.\n\nDon't just be a student of your discipline. Be a researcher of your own potential. Use modern tools to compress learning cycles, test assumptions quickly, and explore questions the syllabus never asks.\n\nThe future doesn't reward those who follow instructions perfectly. It rewards those who noticed the OS was outdated  and took responsibility for upgrading anyway.`,\n        category: 'Education & AI',\n        date: '2025-12-20',\n        readTime: '5 min read',\n        tags: [\n            'Education',\n            'AI',\n            'Learning',\n            'Strategy'\n        ],\n        likes: 0,\n        comments: []\n    },\n    {\n        id: 2,\n        title: 'The Physics of Why Your New Year Will Fail (And How to Win Anyway)',\n        excerpt: 'Physics doesn\\'t negotiate. It only executes. Here\\'s why your resolutions fail and how to fix your system.',\n        content: `Physics doesn't negotiate. It only executes.\nWe have been lied to.\n\nWe've been told that meaning well is the bridge between who we are and who we want to be. But sincerity is a cheap currency. You can be sincerely moving in the wrong direction at high speed  which is nothing more than a faster route to futility.\n\nI'm writing this not as someone who has \"arrived,\" but as someone who is tired of being deceived by my own intentions. I am not an exception. Here is the mechanical reality: your feelings do not dictate your outcomes; your systems do.\n\nThe Gun of Sincere Ignorance\nIgnorance is not just a lack of data; it is a mechanism.\n\nImagine holding a firearm. You may love the person in front of you. You may have zero malice. But if you pull the trigger while the barrel is pointed at them, your sincerity will not stop the bullet. The mechanics of the gun respond to the physics of the trigger, not the heart of the shooter.\n\nMany of us are sincerely pulling triggers on habits we don't understand  daily routines, coping behaviours, and defaults  without realising the barrel is pointed at our own future. This isn't about being a \"bad person.\" It's about a mismatch between what you want and what your systems are actually producing.\n\nPhysics doesn't negotiate. It only executes.\n\nThe Noiseless Transition\nMost people fail because they wait for a sign.\n\nThey wait for the New Year to feel different. They wait for motivation to arrive loudly. But real change is a noiseless effect.\n\nThe moment you see the change, you are already late.\n\nBy the time results are visible in the physical world, the process has already been running for a long time. Change happens in quiet, uncelebrated moments: when you go to sleep earlier without announcing it, when you remove a distraction rather than add a goal, when you choose consistency over intensity.\n\nThe transition is subtle. The compound effect is not.\n\nThe Attention Balance\nStop tracking your status. Start tracking your attention.\n\nAttention is the highest form of currency you possess. What you pay attention to doesn't just consume time  it shapes capability. Every distraction is a withdrawal from the work that actually compounds.\n\nValue is created by rarity. We celebrate unique results, not common ones. If your habits are common  reactive, distracted, socially inherited  your outcomes will be common too.\n\nThis isn't about rejecting society. It's about stepping outside the jurisdiction of default behaviour. Focus is rare. Direction is rare. Sustained effort is rare. That rarity is the edge.\n\nThe Forge: Buying Back the Future\nHere is the leverage: an opportunity once lost can be regained. You are not a victim of your past mistakes; you are the architect of your now.\n\nMove from Sympathy to Empathy\nSympathy sits with the problem and explains it away. Empathy does the harder work  it solves it. Stop asking \"How do I feel?\" and start asking \"What would fix this?\" Knowledge alone doesn't open doors; applied knowledge does.\n\nThe Architecture of Boundaries\nMost failure is not a lack of ambition but a pattern of self-betrayal. When you repeatedly break promises to yourself, your mind stops taking you seriously. Boundaries repair this trust. Change begins when your word becomes reliable again.\n\nThe Investment of Discipline\nYou will pay either way. The pain of discipline is temporary and instructive. The pain of regret is permanent and accumulative. One builds capacity; the other builds resentment. Choose carefully.\n\nThe Future Is Now\nThere is no cinematic rescue coming.\n\nThere is only you, your direction, and the systems you operate daily. Speed in the wrong direction is futile. Speed in the right direction is a breakthrough.\n\nStop comparing your path to others. Comparison misallocates attention and dissolves clarity. Every resource you have is calibrated to your specific assignment. Every present moment is a vote for the future you're constructing.\n\nGain clarity. Set boundaries. Execute the change.\n\nThe light at the end of the tunnel isn't a train.\nIt's the fire you started  and kept feeding  today.`,\n        category: 'Philosophy & Growth',\n        date: '2025-12-31',\n        readTime: '3 min read',\n        tags: [\n            'Philosophy',\n            'Systems',\n            'Growth',\n            'Discipline'\n        ],\n        likes: 0,\n        comments: []\n    }\n];\nconst socials = [\n    {\n        name: 'LinkedIn',\n        url: 'https://www.linkedin.com/in/adeyemi-adeniji-828204253',\n        icon: 'fab fa-linkedin'\n    },\n    {\n        name: 'GitHub',\n        url: 'https://github.com/youngseeker',\n        icon: 'fab fa-github'\n    },\n    {\n        name: 'Email',\n        url: 'mailto:danieladeniji001@gmail.com',\n        icon: 'fas fa-envelope'\n    }\n];\nconst contactEmail = 'danieladeniji001@gmail.com';\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/content.ts\n");

